import '../asset/style/card.css'


const Card = (props) => {
    return (
        <div className="container-Card">
            <div className="card-img">{props.img}</div>
            <div className="card-title"><h3>{props.title}</h3></div><br/>
            <div className="card-price"><span className="text-primary">Precio: </span> {props.price} USD</div><br/>
            <div className="card-amount"><span className="text-primary">Stock: </span>{props.amount}</div><br/>
            <div className="card-description"><span className="text-primary">Descripcion: </span>{props.description}</div>
        </div>
    )
}

export default Card;
